import styled from 'styled-components';

export default styled.section`
  margin: 0 1.06rem;
  padding: 1.06rem 1.44rem;
  background: #fff;
  box-shadow: 0 0 0.25rem 0 rgba(172, 172, 172, 0.5);
  border-radius: 0.31rem;
  text-align: center;
`;
